import React from 'react';
import './App.css';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import "./login/Login";

class App extends React.Component {
  componentDidMount() {
    fetch('/api')
      .then(res => res.text())
      .then(text => console.log(text));
  }

  render() {
    return (
      <div className="wrapper">
        <h1>Application</h1>
        <BrowserRouter>
          <Switch>
            <Route path="/login">
              <Login />
            </Route>
          </Switch>
        </BrowserRouter>
      </div>
    );
  }
}

export default App;
